                <Item icon={item2.icon} title={item2.title} text1={item2.text1} link={item2.link} text2={item2.text2}/>
                <Item icon={item3.icon} title={item3.title} text1={item3.text1} link={item3.link} text2={item3.text2}/>
                <Item icon={item4.icon} title={item4.title} text1={item4.text1} link={item4.link} text2={item4.text2}/>
                <Item icon={item5.icon} title={item5.title} text1={item5.text1} link={item5.link} text2={item5.text2}/>
                <Item icon={item6.icon} title={item6.title} text1={item6.text1} link={item6.link} text2={item6.text2}/>
            </div>

        </div>
    );
};
export default Block4;
